import React from "react";
import {Card, Grid, GridColumn, CardContent, CardHeader, CardDescription} from "semantic-ui-react";

function Planets(data) {
    return (
        <>
            <h1>Planets</h1>
            <Grid columns={3}>
                {data.map((planets,i) => {
                    return(
                        <GridColumn key={i}>
                            <Card>
                                <CardContent>
                                    <CardHeader>{planets.name}</CardHeader>
                                    <CardDescription>
                                        <strong>Climate</strong>
                                        <p>{planets.climate}</p>
                                        <strong>Mass</strong>
                                        <p>{planets.mass}</p>
                                        <strong>Hair Color</strong>
                                        <p>{planets.hair_color}</p>
                                    </CardDescription>
                                </CardContent>
                            </Card>
                        </GridColumn>
                    )
                })}
            </Grid>
        </>
    )
}
export default Planets;
